// src/services/chileCitiesService.js

// Servicio para obtener regiones y comunas de Chile
export const chileCitiesService = {
  
  // ========== OPCIÓN 1: API Digital Gob Chile ==========
  // API gratuita del gobierno de Chile
  getRegionesGobCl: async () => {
    try {
      const response = await fetch('https://apis.digital.gob.cl/dpa/regiones');
      const data = await response.json();
      return data.map(region => ({
        codigo: region.codigo,
        nombre: region.nombre
      }));
    } catch (error) {
      console.error('Error al obtener regiones:', error);
      return chileCitiesService.getRegionesLocal(); // Fallback a datos locales
    }
  },

  getComunasGobCl: async (codigoRegion) => {
    try {
      const response = await fetch(`https://apis.digital.gob.cl/dpa/regiones/${codigoRegion}/comunas`);
      const data = await response.json();
      return data.map(comuna => ({
        codigo: comuna.codigo,
        nombre: comuna.nombre
      }));
    } catch (error) {
      console.error('Error al obtener comunas:', error);
      return [];
    }
  },

  getAllComunasGobCl: async () => {
    try {
      // Obtener todas las regiones primero
      const regiones = await chileCitiesService.getRegionesGobCl();
      const allComunas = [];
      
      // Obtener comunas de cada región
      for (const region of regiones) {
        const comunas = await chileCitiesService.getComunasGobCl(region.codigo);
        comunas.forEach(comuna => {
          allComunas.push({
            ...comuna,
            region: region.nombre,
            regionCodigo: region.codigo
          });
        });
      }
      
      return allComunas.sort((a, b) => a.nombre.localeCompare(b.nombre));
    } catch (error) {
      console.error('Error al obtener todas las comunas:', error);
      return chileCitiesService.getComunasLocal();
    }
  },

  // ========== OPCIÓN 2: DATOS LOCALES (BACKUP) ==========
